        <nav className="navbar navbar-expand-lg navbar-light" style={{backgroundColor: "#e3f2fd"}}>
            <div className="container">
                <Link to="/" className="brand-logo">Logo here</Link>
                {/*{links}*/}
                <SignInLinks />
                <SignOutLinks />
                {/*<NavLinks />*/}
